import React, { useState, useEffect } from "react";
import axios from "axios";
import { ArrowDown, ArrowUp,} from "../../common/icons/icons";
import { Link, NavLink } from "react-router-dom";
import { useSelector } from "react-redux";

const ContractEmployeeMain = () => {
  const [users, setUsers] = useState(null);
  const { id } = useParams();

    


  useEffect(() => {
    getUsers();
  }, []);

  const getUsers = async () => {
    const response = await axios.get("http://localhost:5000/users");
    setUsers(response.data);
  };


  return (
    <div>
      <div className="div-table">
        <div className="div-table-options">
          <NavLink className="table-options" to="/adduser">Dodaj użytkownika</NavLink>
        </div>
        <table className="employee-table">
          <thead>
            <tr className="employee-tr">
              <th>Stanowisko</th>
              <th>Start Kontraktu</th>
              <th>Koniec Kontraktu</th>
              <th>Rodzaj Kontraktu</th>
              <th className="employee-setting">Opcje</th>
            </tr>
          </thead>
          <tbody>
            
            {/* <React.Fragment key={user.id}>
            <tr key={user.uuid} className="employee-tr" > */}
               <td className="employee-profile td-employee">
                </td>
                  {/* <td className="td-employee">
                  {user.profile && user.profile.contracts[0]  ? (user.profile.contracts[0].position ) : ("Brak danych" )}
                  </td>
                  <td className="td-employee">
                  {user.profile && user.profile.contracts[0]  ? (user.profile.contracts[0].startContract ) : ("Brak danych" )}
                  </td>
                  <td className="td-employee">
                  {user.profile && user.profile.contracts[0]  ? (user.profile.contracts[0].endContract ) : ("Brak danych" )}
                  </td>
                  <td className="td-employee">
                  {user.profile && user.profile.contracts[0]  ? (user.profile.contracts[0].typeContract ) : ("Brak danych" )}
